{
	-webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3);
	background-color: #F5F5F5;
}

-webkit-scrollbar
{
	width: 6px;
	background-color: #F5F5F5;
}

-webkit-scrollbar-thumb
{
	background-color: #000000;
}


.sidebar {

}
.containerProdutos{
  height:calc(100vh - 160px);
  width:100%;

}
`;
